class SearchResult extends Component {
    state = {  }
    render() { 
           if (this.props.info.length <= 0) {
            return (
              <div className="gozareshat-bg p-3 col-lg-10">
                <div className="w-100 notFound-box">
                  <span>
                    متاسفانه موردی برای
                    <b className="p-2">{this.stpropsate.filter}</b>
                    یافت نشد.
                  </span>
                  <button
                    onClick={() => this.props.history.replace("/Gozareshat")}
                    className="btn bordered-btn"
                  >
                    بازگشت
                  </button>
                </div>
              </div>
            );
          } 
    }
}
 
export default SearchResult;
